import React from 'react';
import { List } from 'antd';

// {id, projectid, userid, jobid, matchpercent}

const Scan = (props) => {
    return (
        <List
        itemLayout="vertical"
        size="large"
        pagination={{
        onChange: page => {
            // console.log(page);
        },
        pageSize: 3,
        }}
        dataSource={props.data}
        renderItem={item => (
        <List.Item
            key={item.title}
        >
        <List.Item.Meta
          title={<a href={"/scan/" + item.id} >Position: {item.jobid}</a>}
          description={"Created on " + item.posted_date}
        />
        {item.description}
      </List.Item>
    )}
  />
  )
}

export default Scan;
